import React from "react";
import { NavLink } from "react-router-dom";

const About = () =>{

    return(
        <>
        <div>
            <ul>
                <li> <NavLink exact activeClassName='active_class' to= '/about/ghani' >Graduation</NavLink></li>
                <li> <NavLink exact activeClassName='active_class' to= '/about/Habbits' >Habbits</NavLink></li>
                <li> <NavLink exact activeClassName='active_class' to= '/about/personal' >personalinfo</NavLink></li>
           
            </ul>
        </div>
        </>
    )
}
export default About ;
